import React from 'react';
import Logo from './images/booksandbrewskies/logo.png';
import { Link } from 'react-scroll';

const Header = () => {

  return (
    <nav className="site-header sticky-top py-1" style={{ backgroundColor: "#130f0a", opacity: "0.9" }}>
      <div className="container d-flex flex-md-row justify-content-between" style={{ maxWidth: "960px" }}>
        <a className="py-2" aria-label="Product"><img src={Logo} alt="logo" height="50px" width="50px" /></a>
        <Link
          activeClass='active'
          to="store"
          spy={true}
          smooth={true}
          offset={-70}
          duration={500}
          href=''
          className="py-2 d-md-inline-block mt-2"
        >
          Store
</Link>
        <Link
          activeClass='active'
          to="platforms"
          spy={true}
          smooth={true}
          offset={0}
          duration={500}
          href=''
          className="py-2 d-md-inline-block mt-2"
        >
          Podcast
</Link>
        <Link
          activeClass='active'
          to="special-events"
          spy={true}
          smooth={true}
          offset={0}
          duration={500}
          href=''
          className="py-2 d-md-inline-block mt-2"
        >
          Special Events
</Link>
        <Link
          activeClass='active'
          to="team"
          spy={true}
          smooth={true}
          offset={0}
          duration={500}
          href=''
          className="py-2 d-md-inline-block mt-2"
        >
          Team
</Link>

      </div>
    </nav>
  )
}

export default Header;
